import { useCallback } from "react";
import { useNavigate } from "react-router-dom";
import Component3 from "../../components/Component3";
import HomeIndicators from "../../components/HomeIndicators";
import styled from "styled-components";

const Home = styled.div`
  position: absolute;
  top: 0px;
  left: 0px;
  border-radius: var(--br-mini);
  background-color: var(--color-gray-100);
  width: 360px;
  height: 780px;
  overflow: hidden;
`;
const B = styled.b`
  position: absolute;
  top: 128px;
  left: 30px;
  font-size: var(--font-size-xl);
  line-height: 22px;
`;
const FrameChild = styled.div`
  position: absolute;
  top: 99.75px;
  left: -0.25px;
  border-top: 0.5px solid var(--color-gray-300);
  box-sizing: border-box;
  width: 313.5px;
  height: 0.5px;
`;
const Div1 = styled.div`
  position: absolute;
  top: 0px;
  left: 0px;
  font-size: var(--font-size-lg);
  font-weight: 500;
  color: var(--label-color-light-primary);
`;
const Div2 = styled.div`
  position: absolute;
  top: 27px;
  left: 0px;
`;
const Span2 = styled.span``;
const Span = styled.span`
  font-size: var(--paragraph-2-size);
  font-weight: 100;
`;
const Div3 = styled.div`
  position: absolute;
  top: 60px;
  left: 0px;
`;
const Parent1 = styled.div`
  position: absolute;
  top: 0px;
  left: 10px;
  width: 138px;
  height: 78px;
`;
const LineParent = styled.div`
  position: absolute;
  top: 171px;
  left: 23px;
  width: 313px;
  height: 100px;
  color: var(--color-gray-200);
`;
const FrameItem = styled.div`
  position: absolute;
  top: 105.75px;
  left: -0.25px;
  border-top: 0.5px solid var(--color-gray-300);
  box-sizing: border-box;
  width: 313.5px;
  height: 0.5px;
`;
const Div4 = styled.div`
  position: absolute;
  top: 0px;
  left: 10px;
  font-size: var(--font-size-lg);
  font-weight: 500;
`;
const P = styled.p`
  margin: 0;
`;
const Point = styled.div`
  position: absolute;
  top: 27px;
  left: 10px;
  color: var(--color-gray-200);
`;
const Div6 = styled.div`
  position: absolute;
  top: 74px;
  left: 14px;
  color: var(--color-blue);
`;
const LineGroup = styled.div`
  position: absolute;
  top: 293px;
  left: 23px;
  width: 313px;
  height: 106px;
`;
const FrameInner = styled.div`
  position: absolute;
  top: 107.75px;
  left: -0.25px;
  border-top: 0.5px solid var(--color-gray-300);
  box-sizing: border-box;
  width: 313.5px;
  height: 0.5px;
`;
const Point2 = styled.span`
  font-weight: 100;
`;
const Span1 = styled.span`
  font-size: var(--font-size-mini);
  font-family: var(--font-noto-sans-kr);
`;
const Point1 = styled.p`
  margin: 0;
  font-size: var(--paragraph-2-size);
`;
const Point3 = styled.div`
  position: absolute;
  top: 79px;
  left: 14px;
  color: var(--color-blue);
`;
const LineContainer = styled.div`
  position: absolute;
  top: 421px;
  left: 23px;
  width: 313px;
  height: 108px;
`;
const LineDiv = styled.div`
  position: absolute;
  top: 104.75px;
  left: -0.25px;
  border-top: 0.5px solid var(--color-gray-300);
  box-sizing: border-box;
  width: 313.5px;
  height: 0.5px;
`;
const Point6 = styled.div`
  position: absolute;
  top: 76px;
  left: 14px;
  color: var(--color-blue);
`;
const FrameDiv = styled.div`
  position: absolute;
  top: 543px;
  left: 23px;
  width: 313px;
  height: 113px;
`;
const DivRoot = styled.div`
  position: relative;
  width: 100%;
  height: 780px;
  text-align: left;
  font-size: var(--font-size-mini);
  color: var(--label-color-light-primary);
  font-family: var(--font-noto-sans-kr);
`;
const Frame = () => {
  const navigate = useNavigate();

  const onButtonClick = useCallback(() => {
    navigate("/main");
  }, [navigate]);

  return (
    <DivRoot>
      <Home>
        <Component3 onButtonClick={onButtonClick} />

        <HomeIndicators />
      </Home>
      <B>알림</B>
      <LineParent>
        <FrameChild />
        <Parent1>
          <Div1>2023.09.08</Div1>
          <Div2>검사가 완료되었습니다.</Div2>
          <Div3>
            <Span2>{`배터리 수명 : `}</Span2>
            <Span>98 %</Span>
          </Div3>
        </Parent1>
      </LineParent>
      <LineGroup>
        <FrameItem />
        <Div4>2023.08.31</Div4>
        <Point>
          <P>배터리가 50% 미만입니다. 건강한 배터리</P>
          <P>충전습관을 위해서 지금 충전하세요.</P>
        </Point>
        <Div6>근처 충전소 찾기</Div6>
      </LineGroup>
      <LineContainer>
        <FrameInner />
        <Div4>2023.07.08</Div4>
        <Point>
          <P>축하드립니다. 지난달 건강한 충전습관으로</P>
          <Point1>
            <Point2>80 point</Point2>
            <Span1> 적립되었습니다</Span1>
          </Point1>
        </Point>
        <Point3>point 사용처 보기</Point3>
      </LineContainer>
      <FrameDiv>
        <LineDiv />
        <Div4>2023.06.08</Div4>
        <Point>
          <P>축하드립니다. 지난달 건강한 충전습관으로</P>
          <P>100 point 적립되었습니다</P>
        </Point>
        <Point6>point 사용처 보기</Point6>
      </FrameDiv>
    </DivRoot>
  );
};

export default Frame;
